import React from 'react';
import './App.css';
import { WuphfForm } from './components';
import { formOptions } from './constants/formOptions';

function App() {
  return (
    <div className='App'>
      <div class='outer-div'>
        <div class='mid-div'>
          <div class='center-div'></div>
        </div>
      </div>
      <WuphfForm formOptions={formOptions}></WuphfForm>
    </div>
  );
}

export default App;
